import React, { useContext} from "react";
// import Provider from "./Provider";
import Acontext from './Context' 



const Consumer = ()=>{
   
    const a = useContext(Acontext);
    return(
        <div className="container">
            <h3 className="text-success"> Hello Mr. Anurag You have Assigned a new mission</h3>
             <h3 className="text-success">Mission: {a.data.mname}</h3>
             
             <h3 className="text-success">Agent Name: {a.data.agent}</h3>
             
             <h3 className="text-success">Status: {a.data.status}</h3>

             <h3>Date: {a.data.date}</h3>
            <div className="container"> <img src={a.data.imag} /></div>

             <button onClick={a.accept}>Accept Mission</button>
        </div>
    )
}

export default Consumer;
